import React from "react";
import {Link} from "react-router-dom";
import "./Html.css";
import Service from "../service/Service";

class Html extends React.Component{
    constructor(props){
        super(props)
        this.state={
            htmls:[]
        }
    }
    componentDidMount(){
        Service.getHtml().then((response) => {
            this.setState({htmls:response.data})

        });
    }
    render(){
        const content={
            width:"88.85%",
            height: "fit-content",  
            padding: "5px",
            marginTop: "-878px",
            marginLeft: "176px",
            backgroundColor:"silver"
        };
        return(
            <div>
                <div class="feed1">
                    {
                        this.state.htmls.map(
                        html =>
                        <ul key={html.id}>
                            <Link to=""><li>{html.name}</li></Link>
                        </ul>
                        )
                    }
                </div>
                <div>
                    <div class={content}>

                    </div>
                </div>
            </div>
        )
    }
}
export default Html;
